script: |
  super -f text -I q2616.spq | sort > q2616.out

inputs:
  - name: q2616.spq
    data: |
      SELECT - col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - col0 * - - col2 + 29 BETWEEN - - col2 + - - 80 AND + + col1;
  - name: tab2

outputs:
  - name: q2616.out
    data: |
      -46
      -64
      -75
